    __webpack_exports__["default"] = "<ion-header>\n  <ion-toolbar color=\"light\">\n    <ion-buttons slot=\"start\">\n      <ion-menu-button color=\"primary\"></ion-menu-button>\n    </ion-buttons>\n    <ion-title color=\"primary\">Nutribebe</ion-title>\n  </ion-toolbar>\n</ion-header>\n\n<ion-content>\n  <ion-card>\n    <img src=\"assets/img/nutribebe.jpg\" alt=\"\" srcset=\"\">\n    <ion-card-header>\n      <ion-card-subtitle>6 meses a 23 meses</ion-card-subtitle>\n      <ion-card-title>Nutribebe</ion-card-title>\n    </ion-card-header>\n    <ion-card-content>\n      <ion-text color=\"dark\">\n        El Nutribebé es un alimento muy importante ya que ayuda a prevenir la desnutrición y que él bebé debe de\n        consumir a partir de los 6 meses, acude a tu centro de salud más cercano y realiza el control de niño sano para\n        que te puedan entregar cada mes, son 2 bolsitas que te entregaran y son equivalentes a 1 mes. Él bebe debe de\n        comer este suplemento 2 veces al día, preferentemente a media mañana y media tarde, no olvidemos cumplir los 5\n        tiempos de comida que son DESAYUNO, MEDIA MAÑANA, ALMUERZO, MEDIA TARDE, CENA.\n      </ion-text>\n      <ion-text color=\"primary\">\n        <h4>Preparación base del Nutribebé</h4>\n      </ion-text>\n      <ul>\n        <li>Nutribebé 1 cuchara medidoras 25g de Nutribebé </li>\n        <li>Agua 2 cucharas medidoras 100 ml </li>\n        <li>Alimento opcional de preferencia, sea aplastado, triturado o hervido</li>\n        <li>Un recipiente o platito hondo </li>\n        <li>Una cucharilla (para mezclar el alimento). </li>\n        <li>Una cuchara medidora que le entregarán con la bolsa del Nutribebé. </li>\n        <li>Cucharilla para alimentar al menor de 2 años. </li>\n      </ul>\n      <ion-text color=\"primary\">\n        <h4>Preparación</h4>\n      </ion-text>\n      <ion-text color=\"dark\">\n        Llenar la cuchara medidora con el alimento complementario Nutribebé, colocar en un platito, si quieres puedes\n        agregar el alimento opcional de tu preferencia, añadir una medida de agua hervida tibia o fría y mezclar, añadir\n        una segunda medida de líquido poco a poco hasta obtener una papilla o puré. Darle la papilla a la niña o el niño\n        hasta que termine, no se debe guardar el producto preparado.\n        <br>\n        <ion-text color=\"medium\">\n          ¿Con que líquidos puedo mezclar?\n        </ion-text>\n        <br>\n        Puede ser con leche, leche materna, agua o jugo de frutas que sean hervidas previamente (no jugo de frutas\n        azucarados)\n        <ion-slides [options]=\"slideOpts\" pager=\"true\">\n          <ion-slide>\n            <img src=\"assets/img/nutribebe/1.png\" alt=\"\" srcset=\"\">\n          </ion-slide>\n          <ion-slide>\n            <img src=\"assets/img/nutribebe/2.png\" alt=\"\" srcset=\"\">\n          </ion-slide>\n          <ion-slide>\n            <img src=\"assets/img/nutribebe/3.png\" alt=\"\" srcset=\"\">\n          </ion-slide>\n        </ion-slides>\n      </ion-text>\n      <table style=\"width:100%\">\n        <tr>\n          <th>Edad</th>\n          <th>Alimentos</th>\n          <th>Cantidades</th>\n        </tr>\n        <tr>\n          <td>De 6 a 8 meses</td>\n          <td>Zapallo, guineo, manzana, pera, papaya.</td>\n          <td>5 comidas al día, entre 6 a 8 cucharas en cada comida</td>\n        </tr>\n        <tr>\n          <td>De 9 a 11 meses</td>\n          <td>Durazno, zanahoria, camote y melón.</td>\n          <td>5 comidas al día, entre 9 a 11 cucharas en cada comida</td>\n        </tr>\n        <tr>\n          <td>De 12 meses a menor de 2 años</td>\n          <td>Mandarina, naranja, sandia, coco, yogurt, avena, leche, quinua</td>\n          <td>5 comidas al día, entre 12 a 15 cucharas en cada comida</td>\n        </tr>\n      </table>\n      <ion-text color=\"medium\">\n        Cabe recalcar que los alimentos deben estar aplastados, triturados o hervidos antes de dar al bebé\n        NOTA* al comenzar con la alimentación complementaria debes de comenzar con 3 cucharas en cada comida e ir\n        progresando hasta llegar a las 6 cucharas y de ahí por cada mes que pase se aumenta una cuchara más al bebe\n\n      </ion-text>\n      <iframe width=\"100%\" height=\"315\" src=\"https://www.youtube.com/embed/gbTC0bM1oCQ\" frameborder=\"0\"\n        allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n    </ion-card-content>\n  </ion-card>\n</ion-content>";
